This is a macro

It sort of interesting that the way that we create a new macro is with a macro. So it’s nice and recursive like that. The macro in question, will be none other than `macro_rules!`!.

OK, so that means something like this:

```no-test
macro_rules! `ident` {
    ($[ ( | `ident`]<,)*>[,$ident]*) => {
    }
}
```
